import React, { useState } from 'react';
import { AgChartsReact } from 'ag-charts-react';

// Chart Component
const Visibility = ({data}) => {
  const data_parse = data.list.splice(0,8)
  const [chartOptions, setChartOptions] = useState({
    title: {text:"Visibility"},
    data: [
        { time: new Date(data_parse[0].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[1].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[2].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[3].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[4].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[5].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[6].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[7].dt * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[8].dt * 1000).getHours(), visibility: data_parse[0].visibility},
    ],
    series: [{ type: 'line', xKey: 'time', yKey: 'visibility (km)' }],
    axes: [{type: 'Time', position: 'bottom'}, {type: 'visibility (m)', position: 'right'}],

  });
  return    <AgChartsReact options={chartOptions} />;
};

export default Visibility;
